"use client";

import React, { useEffect, useMemo, useState } from 'react';
import { useTheme } from "next-themes";
import { Cloud, fetchSimpleIcons, renderSimpleIcon } from "react-icon-cloud";
import './About.css';
import profileImage from './path-to-your-image.jpg';
import awsDeveloperLogo from './path-to-aws-developer-logo.png';
import awsCloudPractitionerLogo from './path-to-aws-cloud-practitioner-logo.png';

const cloudProps = {
  containerProps: {
    style: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      width: "100%",
      paddingTop: 40,
    },
  },
  options: {
    reverse: true,
    depth: 1,
    wheelZoom: false,
    imageScale: 2,
    activeCursor: "default",
    tooltip: "native",
    initial: [0.1, -0.1],
    clickToFront: 500,
    tooltipDelay: 0,
    outlineColour: "#0000",
    maxSpeed: 0.04,
    minSpeed: 0.02,
  },
};

const renderCustomIcon = (icon, theme) => {
  const bgHex = theme === "light" ? "#f3f2ef" : "#080510";
  const fallbackHex = theme === "light" ? "#6e6e73" : "#ffffff";
  const minContrastRatio = theme === "dark" ? 2 : 1.2;

  return renderSimpleIcon({
    icon,
    bgHex,
    fallbackHex,
    minContrastRatio,
    size: 42,
    aProps: {
      href: undefined,
      target: undefined,
      rel: undefined,
      onClick: (e) => e.preventDefault(),
    },
  });
};

const IconCloud = ({ iconSlugs }) => {
  const [data, setData] = useState(null);
  const { theme } = useTheme();

  useEffect(() => {
    fetchSimpleIcons({ slugs: iconSlugs }).then(setData);
  }, [iconSlugs]);

  const renderedIcons = useMemo(() => {
    if (!data) return null;

    return Object.values(data.simpleIcons).map((icon) =>
      renderCustomIcon(icon, theme || "light"));
  }, [data, theme]);

  return (
    <Cloud {...cloudProps}>
      <>{renderedIcons}</>
    </Cloud>
  );
}

const About = () => {
  const iconSlugs = [
    "figma",
    "html5",
    "css3",
    "javascript",
    "react",
    "django",
    "java",
    "amazonaws",
    "visualstudiocode",
    "git",
    "vercel",
    "express",
    "androidstudio"
  ];

  return (
    <div className="about-container">
      <section className="about-section">
        <h2>About</h2>
        <div className="about-content">
          <img src={profileImage} alt="Chirag" className="profile-image" />
          <div className="about-text">
            <p>Hey there! I'm Chirag, a dedicated full-stack web developer with a specialization in cloud technologies. Graduating from Sahyadri College with a degree in Information Science and Engineering, I'm equipped with the skills and knowledge to tackle the digital world's challenges.</p>
            <p>When I'm not busy crafting beautiful websites, you can find me:</p>
            <ul>
              <li>Mastering AWS certifications to stay ahead in cloud computing</li>
              <li>Debugging code swiftly and efficiently</li>
              <li>Pushing boundaries through intense problem-solving sessions, often leading to innovative solutions during late-night coding</li>
              <li>Writing JavaScript and perfecting Python scripts</li>
            </ul>
            <p>I'm always prepared for the storms of tech challenges. Whether you need a full-stack developer or a cloud technology expert, I'm your go-to professional!</p>
          </div>
        </div>
      </section>

      <section className="certification-section">
        <h2>Certification</h2>
        <p>With a strong foundation in cloud computing and full-stack development, I hold certifications that showcase my expertise:</p>
        <div className="certifications">
          <div className="certification">
            <img src={awsDeveloperLogo} alt="AWS Certified Developer" />
            <h3>AWS Certified Developer â€“ Associate</h3>
            <p>Demonstrating proficiency in developing, deploying, and debugging cloud-based applications using AWS.</p>
          </div>
          <div className="certification">
            <img src={awsCloudPractitionerLogo} alt="AWS Certified Cloud Practitioner" />
            <h3>AWS Certified Cloud Practitioner</h3>
            <p>Showcasing comprehensive understanding of AWS Cloud concepts, services, security, architecture, pricing, and support.</p>
          </div>
        </div>
      </section>

      <section className="skills-section">
        <h2>Skills</h2>
        <p>I thrive on working with a diverse range of technologies. My key skills include:</p>
        <div className="icon-cloud-container">
          <IconCloud iconSlugs={iconSlugs} />
        </div>
        <ul>
          <li>Front-End Development: Proficient in HTML, CSS, JavaScript, and React for creating dynamic and responsive web pages.</li>
          <li>Back-End Development: Skilled in Django, Express.js, and Java for building robust server-side applications.</li>
          <li>Cloud Computing: Experienced in AWS services.</li>
          <li>Development Tools: Proficient with Git, Visual Studio Code, Android Studio, and Vercel for efficient development and deployment.</li>
          <li>Design: Capable of creating user interfaces with Figma.</li>
        </ul>
        <p>I enjoy exploring new technologies and am always eager to learn and adapt to the evolving tech landscape.</p>
      </section>
    </div>
  );
};

export default About;
